import React, { useState, useEffect } from 'react';
import { Helmet } from 'react-helmet';
import axios from 'axios';
// import { connect } from 'react-redux';
import { setAlert } from '../actions/alert';
import Loader from 'react-loader-spinner';
import PropTypes from 'prop-types';
import '../assest/Contact.css';

const Contact = ({ setAlert }) => {
	useEffect(() => {
		window.scrollTo(0, 0);
	}, []);

	const [ formData, setFormData ] = useState({
		name: '',
		email: '',
		subject: '',
		message: ''
	});
	const { name, email, subject, message } = formData;
	const [ loading, setLoading ] = useState(false);
	const onChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });
	const onSudmit = (e) => {
		e.preventDefault();
		const config = {
			headers: {
				'Content-Type': 'application/json'
			}
		};
	};
	return (
		<div className="container">
			<div className="row justify-content-center ">
				<div className="col-md-6 col-md-offset-3">
					<div className="well well-sm">
						<form className="form-horizontal" action="" method="post">
							<fieldset className="my">
								<legend className=" col-md-12 text-center">Contact us</legend>

								<div className="form-group">
									<label className="col-md-3 control-label" for="name">
										Name
									</label>
									<div className="col-md-9">
										<input
											id="name"
											name="name"
											type="text"
											placeholder="Your name"
											className="form-control"
										/>
									</div>
								</div>

								<div className="form-group">
									<label className="col-md-3 control-label" for="email">
										Your E-mail
									</label>
									<div className="col-md-9">
										<input
											id="email"
											name="email"
											type="text"
											placeholder="Your email"
											className="form-control"
										/>
									</div>
								</div>

								<div className="form-group">
									<label className="col-md-3 control-label" for="message">
										Your message
									</label>
									<div className="col-md-9">
										<textarea
											className="form-control"
											id="message"
											name="message"
											placeholder="Please enter your message here..."
											rows="5"
										/>
									</div>
								</div>

								<div className="form-group  ">
									<div className="col-md-12 text-center">
										<button type="submit" className=" btn btn-primary btn-lg btn-block">
											Submit
										</button>
									</div>
								</div>
							</fieldset>
						</form>
					</div>
				</div>
			</div>
		</div>
	);
};

export default Contact;
